import React from "react";

import Header from "../partials/Header";
import './Assests/css/Home.css'

export default function HHome() {

    return (
        <>
            <Header />
            <link rel="canonical" href="https://getbootstrap.com/docs/5.3/examples/carousel/"></link>

            <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0/dist/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-9ndCyUaIbzAi2FUVXJi0CjmCapSmO7SnpJef0486qhLnuZ2cdeRhO02iuK6FUUVM" crossorigin="anonymous"></link>
            
            <script src="https://kit.fontawesome.com/630e6cad6a.js" crossorigin="anonymous"></script>

                <div className="homeHospitalSlide">

                    <div id="mycarousel" class="mycarousel">
                        <div class="next_prevbtn">
                            <div class="prev"><button id="prev"><i class="  fa-solid fa-2xl fa-chevron-left"></i></button></div>
                            <div class="next"><button id="next"><i class="fa-solid fa-2xl fa-chevron-right"></i></button></div>
                        </div>
                    </div>
                    
                </div>
        </>
    );
};
